def solution(n):
    answer = 1
    for i in range(1, n//2+1):
        num = 0
        for j in range(i, n+1):
            num += j
            if num == n:
                answer += 1
                break
            if num>n:
                break
    return answer

def solution(n):
    if n == 0:
        return 0
    elif n == 1 or n == 2:
        return 1
    else:
        return solution(n - 1) + solution(n - 2)
